{% block body %}
    <h1>User list</h1>

    <a href=\"{{ path('app_user_new') }}\">Create new User</a>

    <table>
        <thead>
        <tr>
            <th>ID</th>
            <th>Email</th>
            <th>Roles</th>
            <th>Actions</th>
        </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles|join(', ') }}</td>
                <td>
                    <a href=\"{{ path('app_user_edit', {'id': user.id}) }}\">Edit</a>
                    <form method=\"post\" action=\"{{ path('app_user_delete', {'id': user.id}) }}\" onsubmit=\"return confirm('Are you sure you want to delete this user?');\">
                        <input type=\"hidden\" name=\"_token\" value=\"{{ csrf_token('delete' ~ user.id) }}\">
                        <button class=\"btn\">Delete</button>
                    </form>
                </td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
{% endblock %}
", "user/list.html.twig", "C:\\wamp64\\www\\studi-ecf-arcadia\\templates\\user\\list.html.twig");
